import ExpenseItem from "./components/ExpenseItem";

function App() {
    const expenseItems = [
        {
            id: 1,
            title: 'Car Insurance',
            amount: 200.47,
            date: new Date(2020, 10, 12)
        }
    ];

    return (
        <div>
            <h2>Let's get started!</h2>
            <ExpenseItem/>
        </div>
    );
}

export default App;
